import '../'
import '../App.css';


const Navbar = () => {
  return (
    <section class="nav fixed-top">
      <div class="container">
        <div class="row nav-row">
          <div class="col-4 logo">
            
          </div>
          <div class="col-4 nav-menu">
            <a href="#">HOME</a>
            <a href="#">ABOUT US</a>
            <a href="#">CONTACT</a>
          </div>
          <div class="col-4 nav-button">
            <button type="button" class="btn btn-primary btn-lg button-signup">SIGN UP</button>
            <button type="button" class="btn btn-primary btn-lg button-login">LOGIN</button>
          </div>
        </div>
      </div>
    </section>
  );
};
export default Navbar;
